import './App.css';

function App() {
  return (
    <Router>
      <div className="App">
        <AppNavbar />
        <divc className="cota"></divc>
          <Switch>
            <Route exact='/' component={Dashboard}></Route>
          </Switch>
      </div>
    </Router>
  );
}

export default App;
